import React from "react";

import "./GreenHouse.less";
import TabBarAction from "../components/TabBarAction";
import { Image } from "antd-mobile";

import navTaskSrc from '../assets/images/task.png'

const navDataSrc = require("../assets/images/data.png");
const navGreenSrc = require("../assets/images/GreenHouse.png");
const navEquipmentSrc = require("../assets/images/task.png");

const GreenHouses = function GreenHouses(): JSX.Element {
  return (
    <div className="greenHouse-box">
      <div className="navTar">
        <div className="navTar-item">
          <div>任务日志</div>
          <img src={navTaskSrc} />
        </div>
        <div className="navTar-item">
          <div>数据分析</div>
          <img src={navDataSrc} />
        </div>
        <div className="navTar-item">
          <div>大棚管理</div>
          <img src={navGreenSrc} />
        </div>
        <div className="navTar-item">
          <div>设备管理</div>
          <img src={navEquipmentSrc} />
        </div>
      </div>
      <div className="monitorBox">
        <div className="monitorBox-tar">
            <div>
                <img src="assets/images/headTar.png"  />
                <h3>监控管理</h3>
            </div>
            <div>
                <img src="assets/images/right.png" alt="" />
            </div>
        </div>
      </div>
      <TabBarAction />
    </div>
  );
};

export default GreenHouses;
